, poDetails AS (
	SELECT pd.[PONUM], MIN(ph.[ENTERED]) as [PO_Entered], COUNT(pd.[LINENMBR]) as [PO_Lines]
	FROM ponumList pl 
		INNER JOIN PODT pd WITH (nolock) ON pl.[PONUM] = pd.[PONUM]
		INNER JOIN POHD ph WITH (nolock) ON pl.[PONUM] = ph.[PONUM]
	GROUP BY pd.[PONUM]
)
, invoicePayment AS (
	SELECT h.[PONUM], MIN(h.[DATECREATED]) as [First_Entered], MIN(h.[CHECKDT]) as [First_Paid], COUNT(h.[VENDID]) as [Pay_Lines]
	FROM ponumList pl 
		INNER JOIN PODT pd WITH (nolock) ON pl.[PONUM] = pd.[PONUM]
		INNER JOIN [MRI_AUNZ].[dbo].[HIST] h WITH (nolock) ON h.[PONUM] = pd.[PONUM] AND h.[POLINENMBR] = pd.[LINENMBR]
	GROUP BY h.[PONUM]
)
, poCancelled AS (
	SELECT pol.[PurchaseOrderNumber] as [PONUM], MIN(CASE WHEN [LogMsg] LIKE '%Order CANCELLED%' THEN [LogTS] ELSE NULL END) as [First_Cancelled], MAX(pol.[LogTS]) as [Last_MSG]
	FROM ponumList pl 
		INNER JOIN [WSM_AUNZ].[dbo].[wsm_PurchaseOrder_Log] pol WITH (nolock) ON pl.[PONUM] = pol.[PurchaseOrderNumber]
	GROUP BY pol.[PurchaseOrderNumber]
)
, allData AS (
	SELECT pl.[PONUM], pd.[PO_Entered], pd.[PO_Lines], inv.[First_Entered], inv.[First_Paid], inv.[Pay_Lines], pc.[First_Cancelled], pc.[Last_MSG]
	FROM ponumList pl 
		LEFT JOIN poDetails pd ON pl.[PONUM] = pd.[PONUM]
		LEFT JOIN invoicePayment inv ON pl.[PONUM] = inv.[PONUM]
		LEFT JOIN poCancelled pc ON pl.[PONUM] = pc.[PONUM]
)
SELECT [PONUM], [PO_Entered], [PO_Lines], [First_Entered], [First_Paid], [Pay_Lines], [First_Cancelled], [Last_MSG]
FROM allData
WHERE [First_Paid] IS NOT NULL
	AND [First_Paid] > '20170101'
	AND [First_Paid] > [First_Cancelled]
ORDER BY [First_Entered]

